 fazer trabalhos de SEO, conseguindo com esforço e dedicação resultados de sucesso!</p></div><span class=\"timeline-block-footer\" data-v-08dca0e9><i class=\"fa fa-map-marker timeline-block-footer-icon\" data-v-08dca0e9></i><span class=\"timeline-block-local\" data-v-08dca0e9>MBAG Marketing e Publicidade</span><time datetime class=\"timeline-block-date\" data-v-08dca0e9>2013 até hoje</time></span></div></li><li class=\"timeline-block\" data-v-08dca0e9><span class=\"timeline-block-icon\" data-v-08dca0e9></span><div class=\"timeline-block-wrap\" data-v-08dca0e9><div class=\"timeline-block-content\" data-v-08dca0e9><h2 class=\"timeline-block-title\" data-v-08dca0e9><i class=\"fa fa-graduation-cap\" data-v-08dca0e9></i> Ciencias da computação</h2><p class=\"timeline-block-text\" data-v-08dca0e9></p></div><span class=\"timeline-block-footer\" data-v-08dca0e9><i class=\"fa fa-map-marker timeline-block-footer-icon\" data-v-08dca0e9></i><span class=\"timeline-block-local\" data-v-08dca0e9>Faculdade dos Guararapes</span><time datetime class=\"timeline-block-date\" data-v-08dca0e9>de 2013</time></span></div></li><li class=\"timeline-block\" data-v-08dca0e9><span class=\"timeline-block-icon\" data-v-08dca0e9></span><div class=\"timeline-block-wrap\" data-v-08dca0e9><div class=\"timeline-block-content\" data-v-08dca0e9><h2 class=\"timeline-block-title\" data-v-08dca0e9>Curso de Web Designer & Wordpress <i class=\"fa fa-graduation-cap\" data-v-08dca0e9></i></h2><p class=\"timeline-block-text\" data-v-08dca0e9>No Equador tive a oportunidade de realizar o curso de web designer, ganhando conhecimento sobre as ferramentas Adobe e foi onde aprendi a desenvolver site em HTML & CSS (deixando de lado as benditas tabelas). Me interessei muito pela área de front-end e paralelamente fiz um curso na web de desenvolvimento de temas para wordpress e até hoje fico me especializando a cada dia, nesta plataforma.</p></div><span class=\"timeline-block-footer\" data-v-08dca0e9><i class=\"fa fa-map